public class InnerConnectorProfileConnectorProfileConfigFactory(Action<Humidifier.AppFlow.ConnectorProfileTypes.ConnectorProfileConfig> factoryAction = null) : SubResourceFactory<Humidifier.AppFlow.ConnectorProfileTypes.ConnectorProfileConfig>
{

    internal InnerConnectorProfileConnectorProfileCredentialsFactory ConnectorProfileCredentialsFactory { get; set; }

    internal InnerConnectorProfileConnectorProfilePropertiesFactory ConnectorProfilePropertiesFactory { get; set; }

    protected override Humidifier.AppFlow.ConnectorProfileTypes.ConnectorProfileConfig Create()
    {
        var connectorProfileConfigResult = CreateConnectorProfileConfig();
        factoryAction?.Invoke(connectorProfileConfigResult);

        return connectorProfileConfigResult;
    }

    private Humidifier.AppFlow.ConnectorProfileTypes.ConnectorProfileConfig CreateConnectorProfileConfig()
    {
        var connectorProfileConfigResult = new Humidifier.AppFlow.ConnectorProfileTypes.ConnectorProfileConfig();

        return connectorProfileConfigResult;
    }
    public override void CreateChildren(Humidifier.AppFlow.ConnectorProfileTypes.ConnectorProfileConfig result)
    {
        base.CreateChildren(result);

        result.ConnectorProfileCredentials ??= ConnectorProfileCredentialsFactory?.Build();
        result.ConnectorProfileProperties ??= ConnectorProfilePropertiesFactory?.Build();
    }

} // End Of Class

